import React from 'react';
import Cards from './Cards';

const CardsList = ({ people }) => {

	const peo = (cha) => {
		return(
			people && 
				people.map((person, i) => {
					return(
						<Cards person = {people[i]}/>	
				)	
			})
		);
	}

	return(
		<div>
			<Cards person = { peo(people) } />			
		</div>
	)
}

export default CardsList;
